<script>
import router from "@/router";
import BaseDetailList from "@/components/BaseDetailList";

let assetHeaders = {
  asset_nickname: "Asset Nickname",
};

export default {
  components: {
    BaseDetailList
  },
  data() {
    return {
      table: {
        title: "Asset Details",
        assetHeaders: {...assetHeaders},
      },
    };
  },
  props: {
    model: {
      type: Object,
      required: true,
      default: {},
    },
    asset: {
      type: Object,
      required: true,
      default: {},
    },
    recipient: {
      type: Object,
      required: true,
      default: {},
    },
    sender: {
      type: Object,
      required: true,
      default: {},
    },
    query: {
      type: Object,
      default: {},
    }
  },
  methods: {
    showDetails(id) {
      router.push({path: "/payment-records/" + id});
    },
    editDetails(id) {
      router.push({path: "/payment-records/" + id + "/edit"});
    },
    deleteDetails(id) {
      if (id == null) {
        this.$notify({
          message: 'Server error',
          icon: 'tim-icons icon-bell-55',
          type: 'danger'
        });
      } else {
        try {
          this.$store.dispatch('paymentRecords/remove', id)
          this.$notify({
            message: 'Successfully Deleted',
            icon: 'tim-icons icon-bell-55',
            type: 'success'
          });
          this.getResource();
        } catch (e) {
          this.$notify({
            message: 'Server error',
            icon: 'tim-icons icon-bell-55',
            type: 'danger'
          });
        }
      }
    },
    addModel() {
      this.$router.push({
        name: 'Add Payment Record',
        query: this.query
      });
    }
  }
};
</script>
